async def test_attachment_sending_and_receiving(in_memory: bool, client_1: ClientWrapper, client_2: ClientWrapper, body: str, file_names: list[str], payloads: list[bytes]):
	logging.info(f"attachment test: {file_names}")

	try:
		random_prefix = ''.join(random.choice(string.ascii_letters) for _ in range(5))
		for i in range(len(file_names)):
			# add random prefix to avoid collision between test instances
			file_names[i] = f"{random_prefix}_{file_names[i]}"
			# create attachment file
			with open(file_names[i], "wb") as fd:
				fd.write(payloads[i])

		# send message, attachment and check everything is fine
		if in_memory:
			sent_message, message_received = await send_message_with_attachments_in_memory_and_check(client_1, client_2, body=body, file_contents=payloads, filenames=file_names)
		else:
			sent_message, message_received = await send_message_with_attachments_and_check(client_1, client_2, body=body, attachment_paths=file_names)

		# delete previous message (and attachments to resent and download again file)
		bots: list = [
			client_1.create_notification_bot(listeners.MessageDeletedListener(handler=client_1.get_check_content_handler(sent_message, notification_type=listeners.NOTIFICATIONS.MESSAGE_DELETED), count=1)),
			client_2.create_notification_bot(listeners.MessageDeletedListener(handler=client_2.get_check_content_handler(message_received, notification_type=listeners.NOTIFICATIONS.MESSAGE_DELETED), count=1)),
		]

		await client_1.message_delete(message_id=sent_message.id)
		await client_2.message_delete(message_id=message_received.id)
		[await b.wait_for_listeners_end() for b in bots]
	finally:
		for file_name in file_names:
			os.remove(file_name)


async def test_link_preview(client_1: ClientWrapper, client_2: ClientWrapper, link_1: str, link_2: str):
	logging.info(f"link preview test: {link_1}")

	# get discussions and contacts
	discussion_1, discussion_2 = await client_1.get_discussion_associated_to_another_client(client_2), await client_2.get_discussion_associated_to_another_client(client_1)

	# prepare notification bots for this routine
	bots = []

	####
	# create global bots for sent attachments notification
	####
	ideal_sent_attachment_1 = datatypes.Attachment(id=datatypes.AttachmentId(id=0, type=datatypes.AttachmentId.Type.TYPE_OUTBOUND), discussion_id=discussion_1.id, message_id=datatypes.MessageId(type=datatypes.MessageId.Type.TYPE_OUTBOUND), file_name=link_1, mime_type="olvid/link-preview")
	ideal_sent_attachment_2 = datatypes.Attachment(id=datatypes.AttachmentId(id=0, type=datatypes.AttachmentId.Type.TYPE_OUTBOUND), discussion_id=discussion_2.id, message_id=datatypes.MessageId(type=datatypes.MessageId.Type.TYPE_OUTBOUND), file_name=link_2, mime_type="olvid/link-preview")
	bots.append(client_1.create_notification_bot(listeners.AttachmentUploadedListener(handler=client_1.get_check_content_handler(ideal_sent_attachment_1, notification_type=listeners.NOTIFICATIONS.ATTACHMENT_UPLOADED), count=1)))
	bots.append(client_2.create_notification_bot(listeners.AttachmentUploadedListener(handler=client_2.get_check_content_handler(ideal_sent_attachment_2, notification_type=listeners.NOTIFICATIONS.ATTACHMENT_UPLOADED), count=1)))

	####
	# create global bots for received attachments notification
	####
	ideal_received_attachment_1 = datatypes.Attachment(id=datatypes.AttachmentId(id=0, type=datatypes.AttachmentId.Type.TYPE_INBOUND), discussion_id=discussion_1.id, message_id=datatypes.MessageId(type=datatypes.MessageId.Type.TYPE_INBOUND), file_name=link_2, mime_type="olvid/link-preview")
	ideal_received_attachment_2 = datatypes.Attachment(id=datatypes.AttachmentId(id=0, type=datatypes.AttachmentId.Type.TYPE_INBOUND), discussion_id=discussion_2.id, message_id=datatypes.MessageId(type=datatypes.MessageId.Type.TYPE_INBOUND), file_name=link_1, mime_type="olvid/link-preview")
	bots.append(client_1.create_notification_bot(listeners.AttachmentReceivedListener(handler=client_1.get_check_content_handler(ideal_received_attachment_1, notification_type=listeners.NOTIFICATIONS.ATTACHMENT_RECEIVED), count=1)))
	bots.append(client_2.create_notification_bot(listeners.AttachmentReceivedListener(handler=client_2.get_check_content_handler(ideal_received_attachment_2, notification_type=listeners.NOTIFICATIONS.ATTACHMENT_RECEIVED), count=1)))

	####
	# create bots for sent message notifications
	####
	# send messages
	sent_message_1, received_message_2 = await send_message_wait_and_check_content(client_1, client_2, link_1, attachment_count=1)
	sent_message_2, received_message_1 = await send_message_wait_and_check_content(client_2, client_1, link_2, attachment_count=1)

	# update ideals
	ideal_sent_attachment_2.message_id = sent_message_2.id

	# wait for notif to arrive
	for bot in bots:
		await bot.wait_for_listeners_end()


async def test_disable_link_preview(client_1: ClientWrapper, client_2: ClientWrapper, link_1: str):
	logging.info(f"disable link preview test: {link_1}")
	await send_message_wait_and_check_content(client_1, client_2, body=link_1, attachment_count=0, disable_link_preview=True)


async def test_attachment(client_holder: ClientHolder, fast_mode: bool = False):
	for c1, c2 in client_holder.get_one_client_pair_and_reverse():
		await test_attachment_sending_and_receiving(False, c1, c2, "one text attachment", file_names=["test.txt"], payloads=["This is a text attachment".encode()])
		await test_attachment_sending_and_receiving(False, c1, c2, "multiple attachments", file_names=["new_test.txt", "txt.txt", "message.md"], payloads=["This is a text attachment".encode(), "Please work ...".encode(), "# This test is easy ...".encode()])

		if not fast_mode:
			await test_attachment_sending_and_receiving(False, c1, c2, "An amazing image for you", file_names=["image.jpg"], payloads=[base64.b64decode("")])
			await test_attachment_sending_and_receiving(False, c1, c2, body="", file_names=["heavy_file.txt"], payloads=[secrets.choice("abcdefghijklmnopqrstuvvwxyz").encode() * 3_000_000])

		await test_attachment_sending_and_receiving(True, c1, c2, "one text attachment", file_names=["test.txt"], payloads=["This is a text attachment".encode()])
		await test_attachment_sending_and_receiving(True, c1, c2, "multiple attachments", file_names=["new_test.txt", "txt.txt", "message.md"], payloads=["This is a text attachment".encode(), "Please work ...".encode(), "# This test is easy ...".encode()])

		if not fast_mode:
			await test_attachment_sending_and_receiving(True, c1, c2, "An amazing image for you", file_names=["image.jpg"], payloads=[base64.b64decode("")])
			await test_attachment_sending_and_receiving(True, c1, c2, body="", file_names=["heavy_file.txt"], payloads=[secrets.choice("abcdefghijklmnopqrstuvvwxyz").encode() * 3_000_000])

		await test_link_preview(c1, c2, "https://olvid.io", "https://gitlab.com")
		if not fast_mode:
			await test_link_preview(c1, c2, "https://twitter.com/GretaThunberg/status/1608056944501178368", "https://twitter.com/GretaThunberg/status/1608735970131849217")
			await test_link_preview(c1, c2, "https://www.instagram.com/p/CzGIINGt-Za/", "https://www.instagram.com/p/CzENe49Nd9y/")
			await test_link_preview(c1, c2, "https://www.facebook.com/221802305253578_844766734020567", "https://www.facebook.com/350937685051348_835759435220877")
			await test_link_preview(c1, c2, "https://www.youtube.com/watch?v=DiDhqWVF5aw", "https://www.youtube.com/watch?v=c45bD7B5cnA")
			await test_link_preview(c1, c2, "https://www.tiktok.com/@mayemusk_o/video/7296276519758974214", "https://www.tiktok.com/@20vc_tok/video/7293190488448896262")

		await test_disable_link_preview(c1, c2, "https://olvid.io")
		await test_disable_link_preview(c2, c1, "https://example.com")
